import React from 'react';
import { AppBar, Toolbar, Button, Typography } from '@mui/material';
import { Link } from 'react-router-dom';
import './Home.css'; // Import CSS for additional styling

const Home = () => {
  return (
    <div className="home">
      <AppBar 
        position="static"
        sx={{ backgroundColor: '#d84315' }} // Set the AppBar color here
      >
        <Toolbar className="toolbar">
          <Typography variant="h6" className="title">
            My Website
          </Typography>
          <Button component={Link} to="/" color="inherit" className="navButton">Home</Button>
          <Button component={Link} to="/blogs" color="inherit" className="navButton">Blogs</Button>
          <Button component={Link} to="/about" color="inherit" className="navButton">About</Button>
        </Toolbar>
      </AppBar>
      <div className="content">
        <h1>Welcome to the Home Page</h1>
        <p>This is the home page of the website styled with warm red/orange tones.</p>
      </div>
    </div>
  );
};

export default Home;
